const ItemListContainer = ({ greetings, greetings1 }) => (
    <p style={{
      color: "black",
      fontSize: '50px',
      fontWeight: "20px",
      fontFamily: 'Arial Black',
    }}>
      {greetings}
    </p>,
    
    <span style={{
      color: 'orange',
      fontSize: '50px',
    }}>
      {greetings1}
    </span>
);

export default ItemListContainer;
